	function generateData(){//using dict_word to generate data for display

	//Get the index of the word set in similar_tuples
	function getFreqIndex(word) {
		for (var i in similar_tuples) {
			var word_set = similar_tuples[i];
			for (var j in word_set) {
				if(word_set[j]==word)
					return i;
			}
		}
		return -1;
	}

	function getWordList(k) {
		var word_set = similar_tuples[k];
		var similar_words="";
		for (var j in word_set) {
			if(j==0)
				similar_words=similar_words+word_set[0];
			else
				similar_words=similar_words+","+word_set[j];
		}
		return similar_words;
	}

	}

		}

	}
